import React from "react";
import gql from "graphql-tag";
import { useQuery } from "@apollo/react-hooks";

const SINGLE_SONG_QUERY = gql`
  query SINGLE_SONG_QUERY($id: ID!) {
    song(where: { id: $id }) {
      id
      title
      composer {
        id
        name
      }
      publisher
      publishedDate
      altTitle
      instrumental
      fromFilm
      tribute
      artists {
        id
        name
      }
      albums {
        id
        title
      }
      recordings {
        id
        title
      }
    }
  }
`;

const SingleSong = ({ id }) => {
  return <div>Single Song {id}</div>;
};

export default SingleSong;
